  <div class="slide" id="slide4">
    <h2>VIS 2</h2>
    <p>Describe and interpret VIS 2</p>
    <div class="back-button">
      <button onclick="goToSlide(1)">Back to Title</button>
    </div>
  </div>
  <div class="slide" id="slide5">
    <h2>Conclusion</h2>
    <p>End of the presentation. Data source.</p>
  </div>
  <div class="navigation">
    <button onclick="prevSlide()">Previous</button>
    <button onclick="nextSlide()">Next</button>
  </div>

  <script src="./Slideshow Presentation_files/d3.v6.min.js"></script>
  <script>
    let currentSlide = 1;
    const totalSlides = 5;
    const states = ["NSW", "VIC", "QLD", "SA", "WA", "TAS", "NT", "ACT"];
    const colors = d3.scaleOrdinal(d3.schemeCategory10);

    function showSlide(n) {
      document.querySelectorAll('.slide').forEach(slide => {
        slide.classList.remove('active');
      });
      document.getElementById(`slide${n}`).classList.add('active');
      if (n === 2) {
        drawMap();
        drawLineChart(2022);  // Default to 2022
        setupSliders();
      }
    }

    function nextSlide() {
      if (currentSlide < totalSlides) {
        currentSlide++;
        showSlide(currentSlide);
      }
    }

    function prevSlide() {
      if (currentSlide > 1) {
        currentSlide--;
        showSlide(currentSlide);
      }
    }

    function goToSlide(n) {
      currentSlide = n;
      showSlide(n);
    }

    // Function to draw the map on slide 2
    function drawMap() {
      const width = document.getElementById('map').clientWidth;
      const height = document.getElementById('map').clientHeight;

      const svg = d3.select("#map").append("svg")
        .attr("width", width)
        .attr("height", height);

      const projection = d3.geoMercator()
        .center([133.7751, -25.2744])
        .scale(700)
        .translate([width / 2, height / 2]);

      const path = d3.geoPath().projection(projection);

      const color = d3.scaleSequential()
        .domain([0, 40])
        .interpolator(d3.interpolateRgbBasis(["#00f", "#0f0", "#f5deb3", "#ffcc00", "#ff4500", "#f00"]));

      // Create tooltip
      const tooltip = d3.select("body").append("div")
        .attr("class", "tooltip");

      d3.json("https://raw.githubusercontent.com/rowanhogan/australian-states/master/states.geojson").then(function (data) {
        svg.selectAll("path")
          .data(data.features)
          .enter().append("path")
          .attr("d", path)
          .attr("fill", (d, i) => color(i * 8)) // Replace this with actual temperature data if available
          .attr("stroke", "#000")
          .on("mouseover", function (event, d) {
            const stateName = d.properties.STATE_NAME;
            const year = d3.select("#yearSlider").property("value");
            const selectedDate = new Date(year, 0, 1);
            selectedDate.setDate(selectedDate.getDate() + parseInt(d3.select("#dateSlider").property("value")));
            const dateFormatted = d3.timeFormat("%B %d, %Y")(selectedDate);
            const temperature = Math.random() * 40;  // Replace this with actual temperature data
            tooltip.transition()
              .duration(200)
              .style("opacity", .9);
            tooltip.html(`State: ${stateName}<br>Date: ${dateFormatted}<br>Temperature: ${temperature.toFixed(2)}°C`)
              .style("left", (event.pageX + 5) + "px")
              .style("top", (event.pageY - 28) + "px");
          })
          .on("mousemove", function (event) {
            tooltip.style("left", (event.pageX + 5) + "px")
              .style("top", (event.pageY - 28) + "px");
          })
          .on("mouseout", function () {
            tooltip.transition()
              .duration(500)
              .style("opacity", 0);
          });

        // Add legend
        const legendWidth = 300;
        const legendHeight = 20;

        const legendSvg = svg.append("g")
          .attr("class", "legend")
          .attr("transform", `translate(${width - legendWidth - 40}, 40)`);

        const legend = legendSvg.append("defs")
          .append("svg:linearGradient")
          .attr("id", "gradient")
          .attr("x1", "0%")
          .attr("y1", "0%")
          .attr("x2", "100%")
          .attr("y2", "0%")
          .attr("spreadMethod", "pad");

        legend.append("stop")
          .attr("offset", "0%")
          .attr("stop-color", "#00f")
          .attr("stop-opacity", 1);

        legend.append("stop")
          .attr("offset", "25%")
          .attr("stop-color", "#0f0")
          .attr("stop-opacity", 1);

        legend.append("stop")
          .attr("offset", "50%")
          .attr("stop-color", "#f5deb3")  // 麦黄色
          .attr("stop-opacity", 1);

        legend.append("stop")
          .attr("offset", "75%")
          .attr("stop-color", "#ffcc00")  // 橙黄色
          .attr("stop-opacity", 1);

        legend.append("stop")
          .attr("offset", "100%")
          .attr("stop-color", "#f00")
          .attr("stop-opacity", 1);

        legendSvg.append("rect")
          .attr("width", legendWidth)
          .attr("height", legendHeight)
          .style("fill", "url(#gradient)")
          .attr("stroke", "#000");

        const xScale = d3.scaleLinear()
          .domain([0, 40])
          .range([0, legendWidth]);

        const xAxis = d3.axisBottom(xScale)
          .ticks(5);

        legendSvg.append("g")
          .attr("class", "x axis")
          .attr("transform", `translate(0, ${legendHeight})`)
          .call(xAxis);
      }).catch(function (error) {
        console.log(error);
      });
    }

    // Function to draw the line chart on slide 2
    function drawLineChart(year) {
      const container = document.getElementById('line-chart');
      container.innerHTML = '';  // Clear existing chart
      const width = container.clientWidth * 0.55;  // Reduce width by 45%
      const height = container.clientHeight * 0.55;  // Reduce height by 45%

      const svg = d3.select("#line-chart").append("svg")
        .attr("width", width)
        .attr("height", height);

      const margin = { top: 20, right: 150, bottom: 30, left: 40 },
        chartWidth = width - margin.left - margin.right,
        chartHeight = height - margin.top - margin.bottom;

      const chart = svg.append("g")
        .attr("transform", `translate(${margin.left},${margin.top})`);

      const x = d3.scaleTime()
        .domain([new Date(year, 0, 1), new Date(year, 11, 31)])
        .range([0, chartWidth]);

      const y = d3.scaleLinear()
        .domain([0, 40])
        .range([chartHeight, 0]);

      const line = d3.line()
        .x(d => x(d.date))
        .y(d => y(d.value));

      // Sample data for each state
      const data = states.map(state => ({
        state,
        values: Array.from({ length: 12 }, (_, i) => ({
          date: new Date(year, i, 1),
          value: Math.random() * 40
        }))
      }));

      // Draw lines for each state
      const stateLines = chart.selectAll(".state-line")
        .data(data)
        .enter().append("g")
        .attr("class", "state-line");

      stateLines.append("path")
        .attr("class", "line")
        .attr("d", d => line(d.values))
        .attr("fill", "none")
        .attr("stroke", d => colors(d.state))
        .attr("stroke-width", 2)
        .on("mouseover", function (event, d) {
          highlightLine(d.state);
        })
        .on("mouseout", function () {
          resetLines();
        });

      stateLines.append("text")
        .datum(d => ({
          state: d.state,
          value: d.values[d.values.length - 1]
        }))
        .attr("transform", d => `translate(${x(d.value.date)},${y(d.value.value)})`)
        .attr("x", 5)
        .attr("dy", ".35em")
        .style("font", "10px sans-serif")
        .text(d => d.state);

      // Draw x and y axis
      chart.append("g")
        .attr("class", "x axis")
        .attr("transform", `translate(0,${chartHeight})`)
        .call(d3.axisBottom(x).ticks(d3.timeMonth).tickFormat(d3.timeFormat("%b")));

      chart.append("g")
        .attr("class", "y axis")
        .call(d3.axisLeft(y));

      // Draw legend
      const legend = svg.selectAll(".legend")
        .data(states)
        .enter().append("g")
        .attr("class", "legend")
        .attr("transform", (d, i) => `translate(0,${i * 20})`)
        .on("mouseover", function (event, d) {
          highlightLine(d);
        })
        .on("mouseout", function () {
          resetLines();
        });

      legend.append("rect")
        .attr("x", chartWidth + 40)
        .attr("width", 18)
        .attr("height", 18)
        .style("fill", colors);

      legend.append("text")
        .attr("x", chartWidth + 65)
        .attr("y", 9)
        .attr("dy", ".35em")
        .style("text-anchor", "start")
        .text(d => d);

      // Highlight a specific line
      function highlightLine(state) {
        svg.selectAll(".line")
          .style("opacity", 0.1);
        svg.selectAll(".line")
          .filter(d => d.state === state)
          .style("opacity", 1)
          .attr("stroke-width", 4);
      }

      // Reset lines to normal
      function resetLines() {
        svg.selectAll(".line")
          .style("opacity", 1)
          .attr("stroke-width", 2);
      }
    }

    // Function to set up sliders
    function setupSliders() {
      const yearSlider = document.getElementById('yearSlider');
      const yearValue = document.getElementById('yearValue');
      const dateSlider = document.getElementById('dateSlider');
      const dateValue = document.getElementById('dateValue');

      yearSlider.addEventListener('input', function () {
        yearValue.textContent = yearSlider.value;
        drawLineChart(yearSlider.value);  // Update line chart with selected year
      });

      dateSlider.addEventListener('input', function () {
        const year = yearSlider.value;
        const date = new Date(year, 0, 1);
        date.setDate(date.getDate() + parseInt(dateSlider.value));
        dateValue.textContent = d3.timeFormat("%b-%d, %Y")(date);
      });
    }
  </script>
